import Link from 'next/link';
import styles from './Example.module.css'


const Header = () =>(
    <div >
        <Link href='/'>
            <a className={styles.headerCcontainer2}>Home</a>
        </Link>
        <Link href='/contact'>
            <a className={styles.header_container_2}>Contact</a>
        </Link>
    </div>
)

export default Header;
